sap.ui.define(["sap/ui/core/Control","./library","./thirdparty/d3"],function(t){"use strict";return t.extend("openui5.financial.chart.ValueAxis",{metadata:{library:"openui5.financial.chart",properties:{domain:"any",range:"any"}},init:function(){this._scale=d3.scaleLinear()},setDomain:function(t){this._scale.domain(t);this.setProperty("domain",t,true)},setRange:function(t){this._scale.range(t);this.setProperty("range",t,true)},_draw:function(){var t=this.getParent();d3.select("#"+this.getId()).attr("transform",`translate(${t._fPaddingLeft}, ${t._fPaddingTop})`).call(d3.axisLeft(this._scale))}})});